$mergeField = [];
for(var $i = 0;$i<11;$i++){
	$merge = _collectAttributes("_fltSemantics","/.*/","aria-label",_under(_textbox("Search"),25))
	$parent = _parentNode(_fltSemantics($merge[0]),"flt-semantics",1)
	_call($parent.scrollTop=100);
	_wait(1000)
	$merge1 = _collectAttributes("_fltSemantics","/.*/","aria-label",_under(_textbox("Search"),25))
	$parent1 = _parentNode(_fltSemantics($merge1[0]),"flt-semantics",1)
	_call($parent1.scrollTop=100);
	_wait(1000);
	if($merge[0] == $merge1[0]){
		break;
	}
	for(var $j =0; $j<$merge.length;$j++){
		$mergeField.push($merge[$j])
	}
	for(var $k =0; $k<$merge1.length;$k++){
		$mergeField.push($merge1[$k])
	}
}
_log($mergeField)

var $arr = [];
for(var $i=0;$i<$mergeField.length;$i++){
	if(!$arr.includes($mergeField[$i]) && $arr!=null){
	$arr.push($mergeField[$i]);
	}
}
_log($arr)
